import './App.css'; 

function App() {
  const [theme, setTheme] = useState("dark");

    const toggleTheme = () => {
      setTheme((curr) => (curr === "light" ? "dark":"light"));
    }
  return (
    <>
        <Navbar/>
        <LandingPage/>
        <Details />        
        <JoinCommunity />
    </>
  );
}

export default App;
